import React, { Component } from "react";
import Navbar from "./Components/Layouts/Navbar";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="App">
        <Navbar title="Github App" icon="fab fa-twitter" />
      </div>
    );
  }
}

export default App;
